BEGIN TRANSACTION;
CREATE TABLE 'users' ('id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, 'username' VARCHAR NOT NULL, 'ip_address' VARCHAR NOT NULL, 'time_stamp' DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE 'sites' ('id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, 'protocol' VARCHAR DEFAULT NULL, 'domain' VARCHAR NOT NULL, 'path' VARCHAR DEFAULT NULL, 'subdomain' VARCHAR DEFAULT NULL, 'host' VARCHAR NOT NULL, 'tld' VARCHAR NOT NULL, 'parent_domain' VARCHAR DEFAULT NULL, 'active' INTEGER NOT NULL DEFAULT 1 , 'timestamp' DATETIME DEFAULT CURRENT_TIMESTAMP, 'display_name' VARCHAR DEFAULT NULL, 'click_count' INTEGER NOT NULL DEFAULT 0);
CREATE TABLE 'favorite_sites' ('id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,'username' VARCHAR NOT NULL, 'siteid' INTEGER NOT NULL);
COMMIT;
